import * as React from 'react';
import Box from '@mui/material/Box';
import Stepper from '@mui/material/Stepper';
import Step from '@mui/material/Step';
import StepLabel from '@mui/material/StepLabel';
import { Track } from '../types/Track';
import { GoogleMap, useJsApiLoader, Marker } from '@react-google-maps/api';
import { k as apiKey } from '../utils/projectdata';
import { useEffect, useState } from 'react';
import getAddressByCoordinates from '../services/GoogleMaps.services';
// const steps = [
//   'Select master blaster campaign settings',
//   'Create an ad group',
//   'Create an ad',
// ];

export default function TrackStepper(props:{track:Track}) {
    const { isLoaded } = useJsApiLoader({
        id: 'google-map-script',
        googleMapsApiKey: apiKey,
        language: 'he',
      });
      const [geocoder, setGeocoder] = useState<google.maps.Geocoder|null>(null);
      const[steps, setSteps]=useState<string[]|null>(null)
      useEffect(() => {
        if (isLoaded) {
          // Initialize the geocoder
          setGeocoder(new window.google.maps.Geocoder());
        }
      }, [isLoaded]);
      useEffect(()=>{
        fillMySteps();
      },[geocoder])
       function fillMySteps(){
        try{
            // console.log(geocoder)
            let fillSteps=[] as string[];
            
            console.log(getAddressByCoordinates(geocoder,{lat:props.track.startX,lng:props.track.startY}))
            fillSteps.push(( getAddressByCoordinates(geocoder,{lat:props.track.startX,lng:props.track.startY}))!)
            fillSteps.push(( getAddressByCoordinates(geocoder,{lat:props.track.endX,lng:props.track.endY}))!)
            props.track.stops?.forEach(async(value)=>{
                fillSteps.push(( getAddressByCoordinates(geocoder,{lat:value.x,lng:value.y}))!)
            });
            setSteps(fillSteps)
            console.log(fillSteps)
        }catch(error){
            console.log(error)
        }
      }
      useEffect(()=>{
        console.log(steps)
      })
  return (
    <Box sx={{ width: '100%' }}>
      <Stepper activeStep={steps?.length} alternativeLabel>
        {steps&&steps.map((label,index) => (
          <Step key={index}>
            <StepLabel>{label}</StepLabel>
          </Step>
        ))}
      </Stepper>
    </Box>
  );
}
